import React from 'react';
import { Line } from 'react-chartjs-2';

const FxSpotCAT = () => {
  const LineChartData = {
    labels: [
      'Jan',
      'Feb',
      'Mar',
      'Apr',
      'May',
      'Jun',
      'July',
      'Aug',
      'Sep',
      'Oct',
      'Nov',
      'Dec',
    ],
    datasets: [
      {
        data: [12, 15, 18, 40, 35, 38, 32, 20, 25, 15, 25, 30],
        borderColor: '#f10075',
        borderWidth: 1,
        fill: false,
      },
    ],
  };

  const LineChartOptions = {
    maintainAspectRatio: false,
    legend: {
      display: false,
      labels: {
        display: false,
      },
    },
    scales: {
      yAxes: [
        {
          ticks: {
            beginAtZero: true,
            fontSize: 10,
            max: 80,
          },
        },
      ],
      xAxes: [
        {
          ticks: {
            beginAtZero: true,
            fontSize: 11,
          },
        },
      ],
    },
  };
  return (
    <div>
      <div className='container p-md-0'>
        <div className='az-content-body'>
          <div className='ht-20'></div>
          <div className='ht-20'></div>
          <h5 style={{ textAlign: 'center' }}>Fx Spot & CAT</h5>
          <div className='row row-sm mg-b-20'>
            <div className='col-lg-7 ht-lg-100p'>
              <div className='card card-table-one'>
                <div className='row row-sm'>
                  <div className='col-sm-8 col-md-6'>
                    <div className='az-content-label mg-b-5'>Line Chart</div>
                    <p className='mg-b-20'>
                      Below is the basic line chart example.
                    </p>
                    <div className='chartjs-wrapper-demo'>
                      <Line data={LineChartData} options={LineChartOptions} />
                    </div>
                  </div>
                  <div className='col-sm-8 col-md-6 mg-t-20 mg-md-t-0'>
                    <div className='az-content-label mg-b-5'>Area Chart</div>
                    <p className='mg-b-20'>
                      Below is the basic area chart example.
                    </p>
                    <div className='chartjs-wrapper-demo'>
                      <Line data={LineChartData} options={LineChartOptions} />
                    </div>
                  </div>
                  {/* col-6 */}
                </div>
                {/* row */}
              </div>
              {/* row */}
            </div>
          </div>{' '}
          <div className='col-lg-5 mg-t-20 mg-lg-t-0'>
            {' '}
            <div className='card card-table-one'></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FxSpotCAT;
